import React, { Component } from 'react'
import CardList from './components/CardList';
import SearchBox from './components/SearchBox;'
import { robots } from './helpers/robots';

class App extends Component {
  render() {
    return (
      <div className="App">
        <SearchBox/>
        <CardList robots={robots}/>
      </div>
    )
  }
}

export default App
